INSERT INTO `tareas` (`id`, `nombre_t`, `consigna`, `descripcion`, `year`, `usar_sentencias_apertura`, `reportar_estado_animo`, `reportar_conflicto`, `asignaturas_id`, `grupos_id`, `nota`, `descripcion_nota`) VALUES
(3, 'Actividad 1', '', '', 2018, NULL, b'1', b'1', 2, 8, NULL, NULL),
(4, 'Actividad 1', '', '', 2018, NULL, b'1', b'1', 3, 9, NULL, NULL),
(11, 'TP2-Enunciado1', 'Discutir sobre las entidades que conforman el dominio, los atributos y las reglas de negocio de cada uno de los siguientes enunciados, utilizando la herramienta COLLAB.', 'Se espera que el alumno adquiera: Habilidades para la definición y el modelado del dominio de un sistema propuesto. Competencias para el trabajo en equipo.', 2018, b'0', b'1', b'1', 4, 14, NULL, NULL),
(12, 'TP2-Enunciado2', 'Discutir sobre las entidades que conforman el dominio, los atributos y las reglas de negocio de cada uno de los siguientes enunciados, utilizando la herramienta COLLAB.', 'Se espera que el alumno adquiera: Habilidades para la definición y el modelado del dominio de un sistema propuesto. Competencias para el trabajo en equipo.', 2018, b'0', b'1', b'1', 4, 14, NULL, NULL),
(14, 'Diálogos del TP2', 'Ej. 1) \"Analicen las posibilidades de inclusión de diferentes tecnologías de la llamada Web 2.0 para el desarrollo de actividades colaborativas en la propuesta áulica elaborada en el Trabajo práctico anterior (reemplazando las actividades colaborativas presenciales originalmente propuestas). Consensuen la aplicación de al menos tres de ellas y discutan los cambios a introducir en el documento que generaron como resolución del Trabajo Práctico 1\".\r\nEj . 3) \"Analicen las posibilidades de inclusión de rúbricas para la evaluación de cada una de las diferentes tecnologías de la Web 2.0 incluidas en la propuesta de clase elaborada. También analicen las posibilidades de feedback de tales evaluaciones (a los estudiantes y al grupo). Consensuen todo lo analizado y discutan los cambios a introducir en el documento colaborativo creado en la respuesta anterior para incluir las rúbricas y el feedback correspondiente”. ', 'Actividades de diálogo del TP2', 2018, b'0', b'1', b'1', 6, 17, NULL, NULL),
(15, 'Trabajo Práctico Nro 3', 'En grupo, discuta sobre los distintos puntos respecto al tema que se le asignó y realice como resultado un esquema o cuadro conceptual.', '', 2018, b'0', b'1', b'1', 5, 20, NULL, NULL),
(16, 'Trabajo Práctico Nro 4', 'Ver consigna definida en el documento del Trabajo Práctico N° 4', 'No considerar grupo 70. Son alumnos que dejaron de cursar la asignatura', 2018, b'0', b'1', b'1', 5, 21, NULL, NULL),
(17, 'Trabajo Práctico Nro 5', 'Realizar en grupo la tabla solicitada en el práctico 5', 'No considerar grupo 70.', 2018, b'0', b'1', b'1', 5, 21, NULL, NULL),
(21, 'Actividad colaborativa on-line', 'Mediante el uso de la herramienta de comunicación COLLAB (http://chat.fce.unse.edu.ar/ chat/web/index.php) ud. y su grupo deberán dialogar y explicar de manera consensuada los conceptos Autenticación de mensajes y autenticación de transmisores, también deberán explicar el funcionamiento de los esquemas de autenticación ideados por Ong-Schnorr-Shamir, Rivest-Shamir-Adleman, y el esquema conocido como Prueba de mínimo conocimiento o de conocimiento cero. Para cada uno de los esquemas deberán desarrollar un ejemplo.', 'Trabajo grupal on-line de produccion colaborativa', 2018, b'0', b'1', b'1', 10, 26, 10, 'asdsadsad'),
(22, 'Actividad colaborativa on-line', '1)	Ud. deberá leer los documentos disponibles en aula virtual en la carpeta “Agentes” y también buscar material complementario en Biblioteca UCSE o en la web. En este último caso, deberá tener particular cuidado en la elección de fuentes reconocidas (por ejemplo, no se reconocerán datos obtenidos desde fuentes como “monografías.com”). \r\n2)	Mediante el uso de la herramienta de comunicación COLLAB (http://chat.fce.unse.edu.ar/chat/web/index.php) ud. y su grupo deberán dialogar y consensuar respuestas para las siguientes expresiones: agente de software, agente inteligente, sistema multiagente, y sistema basado en agentes.\r\n3)	Mediante el uso de la herramienta de comunicación COLLAB (http://chat.fce.unse.edu.ar/chat/web/index.php) ud. y su grupo deberán dialogar y consensuar la elección de dos metodologías (entre PROMETHEUS, MaSE, GAIA, y CommonKADS) justificando la elección realizada. Luego, para las dos metodologías elegidas deberán resumir sus fases metodológicas y finalmente compararlas. Los criterios de comparación serán propuestos y consensuados por los integrantes del grupo mediante diálogo en COLLAB. ', 'Trabajo individual y grupal (cada grupo será conformado por la cátedra), con producción colaborativa.', 2018, b'0', b'1', b'1', 9, 28, NULL, NULL),
(23, 'Actividad Nro 1', '1) Ud. deberá buscar un recurso en línea como capítulo de libro, blog, video, Objeto virtual de Aprendizaje (OVA), etc., que permita el aprendizaje de pseudocódigo \r\n2) Una vez que usted haya explorado el mejor recurso, deberá proponerlo a su grupo de compañeros de clase, mediante el uso de la herramienta de comunicación COLLAB  (http://chat.fce.unse.edu.ar/chat/web/index.php), \r\n3) Ud. con sus compañeros de grupo considerarán los recursos aportados por los diferentes integrantes. Mediante diálogo y consenso documentado en la herramienta COLLAB, deberán elegir entre todos los aportados sólo dos recursos.\r\n4) Para cada uno de esos dos recursos, Ud. con sus compañeros de grupo, deberán explicar de pseudocódigo: \r\na.	Comandos\r\nb.	Sintaxis para condicional compuesto\r\nc.	Sintaxis para condicional anidado\r\nd.	Sintaxis ciclo “Para”\r\ne.	Sintaxis ciclo “Mientras”\r\nEl diálogo que permita consensuar el desarrollo de estos puntos debe quedar documentado en la herramienta COLLAB. \r\n', 'Experiencia colaborativa llevada a cabo por grupos de la Institución Universitaria Centro de Estudios Superiores de Colombia', 2018, b'0', b'1', b'1', 8, 30, NULL, NULL),
(24, 'Trabajo Práctico', 'Realice las actividades detalladas en el documento que se adjunta en el área del chat.', 'Actividad colaborativa realizada en la asignatura HCI en Colombia', 2018, b'0', b'0', b'0', 11, 31, NULL, NULL),
(25, 'Actividad 1', '', '', 2018, b'0', b'0', b'0', 12, 32, NULL, NULL),
(26, 'TP1', '', '', 2019, b'0', b'0', b'0', 13, 34, NULL, NULL),
(27, 'Actividad 1', 'Mediante el diálogo con sus compañeros de grupo deberán establecer claramente porqué es necesario considerar la relación entre Etica e Inteligencia Artificial (IA), emitir un juicio de valor sobre su importancia, ejemplificar situaciones que se vinculen con esa relación, y analizar su posible impacto en el futuro de la IA. Para iniciar el desarrollo de la actividad se sugiere leer con atención el documento “Directrices éticas sobre una IA confiable” publicado por la Unión Europea en diciembre pasado (https://ec.europa.eu/digital-single-market/en/news/draft-ethics-guidelines-trustworthy-ai), para luego ampliar sus fuentes de información buscando y accediendo a otros  documentos que juzgue adecuados.', 'Grupos formados al azar', 2019, b'0', b'0', b'0', 14, 35, 10, 'asdsad'),
(28, 'Actividad 1 y 2', '', '', 2019, b'0', b'0', b'0', 15, 36, NULL, NULL),
(29, 'Trabajo Práctico 2: Herramientas de la Web 2.0', 'Analicen las posibilidades de inclusión de diferentes tecnologías de la llamada Web 2.0 para el desarrollo de actividades colaborativas en la propuesta áulica elaborada en el Trabajo práctico anterior (reemplazando las actividades colaborativas presenciales originalmente propuestas). Consensuen la aplicación de tres de ellas y discutan los cambios a introducir en el documento que generaron como resolución del Trabajo Práctico 1. Toda duda deberá ser formulada formalmente por mail al profesor. (Se suministra enunciado completo del TP2 en PDF via email)', 'Esta actividad es realizada con grupos creados de manera manual teniendo en cuenta ubicación geográfica.', 2020, b'0', NULL, NULL, 16, 42, NULL, NULL),
