(46, 'Práctico 2', '\"Analicen las posibilidades de inclusión de diferentes tecnologías de colaboración (frecuentemente denominadas “de la Web 2.0”) para el desarrollo de actividades colaborativas en la propuesta áulica elaborada en el Trabajo práctico anterior, a fin de reemplazar las actividades colaborativas presenciales allí propuestas. Consensúen la aplicación de al menos tres de ellas y discutan los cambios a introducir en el documento que generaron como resolución del Trabajo Práctico 1\". Toda duda deberá ser formulada formalmente al profesor utilizando el grupo de WhatsApp disponible para esta cursada.', 'Práctico 2', 2022, b'0', NULL, NULL, 24, 56, NULL, NULL),
